	function validarCPF(Objcpf){
		var snackbarContainer = document.querySelector('#mensagem');
		var j = jQuery.noConflict();
	    var cpf = Objcpf.value;
	    var div = document.getElementById("msgcpf");
	    exp = /\.|\-/g
	    cpf = cpf.toString().replace( exp, "" ); 
	    var digitoDigitado = eval(cpf.charAt(9)+cpf.charAt(10));
	    var soma1=0, soma2=0;
	    var vlr =11;

	    if (cpf.length != 11 || cpf == "00000000000" || cpf == "11111111111" || cpf == "22222222222" || cpf == "33333333333" || cpf == "44444444444" || cpf == "55555555555" || cpf == "66666666666" || cpf == "77777777777" || cpf == "88888888888" || cpf == "99999999999")

		{
			var data = {message: 'CPF inv√°lido, Tente novamente!'};
			snackbarContainer.MaterialSnackbar.showSnackbar(data);
			j('#cpfdiv').removeClass('info').addClass('erro');
			j('#msgcpf' ).html( '' );
			j('#msgcpf').append("<i class='icon-remove'></i>");
		} else 
		{
			// Valida 1o digito
			add = 0;
			for (i=0; i < 9; i ++)
				add += parseInt(cpf.charAt(i)) * (10 - i);
			rev = 11 - (add % 11);
			if (rev == 10 || rev == 11)
				rev = 0;
			
			
			// Valida 2o digito
			add2 = 0;
			for (i = 0; i < 10; i ++)
				add2 += parseInt(cpf.charAt(i)) * (11 - i);
			rev2 = 11 - (add2 % 11);
			if (rev2 == 10 || rev2 == 11)
				rev2 = 0;

		    if((rev != parseInt(cpf.charAt(9))) || (rev2 != parseInt(cpf.charAt(10))))
		    {
		      var data = {message: 'CPF inv√°lido, Tente novamente!'};
	    	  snackbarContainer.MaterialSnackbar.showSnackbar(data);
		  	  j('#cpfdiv').removeClass('info').addClass('erro');
		  	  j('#msgcpf' ).html( '' );
		  	  j('#msgcpf').append("<i class='icon-remove'></i>");
		    } else {
		    	j('#cpfdiv').removeClass('erro').addClass('info');
		    	j('#msgcpf' ).html( '' );
		  	  	j('#msgcpf').append("<i class='icon-ok'></i>");
			}
		}
	}

