	function validarEvento() {
		var snackbarContainer = document.querySelector('#mensagem');
		var j = jQuery.noConflict();
	    var cpf = document.getElementById('cpf').value;
	    exp = /\.|\-/g
	    cpf = cpf.toString().replace( exp, "" ); 
	    var digitoDigitado = eval(cpf.charAt(9)+cpf.charAt(10));
	    var soma1=0, soma2=0;
	    var vlr =11;

	    for(i=0;i<9;i++){
            soma1+=eval(cpf.charAt(i)*(vlr-1));
            soma2+=eval(cpf.charAt(i)*vlr);
            vlr--;
   	 	}
    	soma1 = (((soma1*10)%11)==10 ? 0:((soma1*10)%11));
    	soma2=(((soma2+(2*soma1))*10)%11);

	    var digitoGerado=(soma1*10)+soma2;
	    if(digitoGerado!=digitoDigitado)
	    {
	    	var data = {message: 'CPF inv√°lido, Tente novamente!'};
			snackbarContainer.MaterialSnackbar.showSnackbar(data);
			return false;
	    } else {
			if(document.getElementById("g-recaptcha-response").value.length < 1){
				document.getElementById("g-recaptcha-response").focus();
				var data = {message: 'Captcha inv√°lido, Tente novamente!'};
				snackbarContainer.MaterialSnackbar.showSnackbar(data);
				return false
				}
	    	return true;
    	}
	}



